import React from 'react'

class AddFishForm extends React.Component {

  createFish = (e) => {
    e.preventDefault();
    console.log('making a fish')
  }
  render() {
    return (
      <form className="fish-edit" onSubmit={this.createFish}>
        <input name='name' ref type='text' placeholder= 'Name' />
        <input name='price' ref type='text' placeholder= 'Price' />
        <select name='status' ref>
          <option value="available">Fresh!</option>
          <option value="unavailable">Sold Out!</option>
        </select>
        <textarea name='description' ref placeholder= 'Description' />
        <input name='image' ref type='text' placeholder= 'Image' />
        <button type='submit'>+ Add Fish</button>
      </form>
    )
  }
}

export default AddFishForm
